import { useState } from 'react'
import Task from '../components/Task'
import AddTask from '../components/AddTask'
import Menu from '../components/Menu'
import BannerImage from '../components/BannerImage'
import { connect } from 'react-redux'

const Tasks = (props) => {
  const [taskColor, setTaskColor] = useState(false)

  const taskComplete = colorComplete => {
    setTaskColor(!taskColor)
    var colorComplete = 'rgba(30, 250, 22, 0.2)'
    taskColor
      ? (colorComplete = 'rgba(30, 250, 22, 0.2)')
      : (colorComplete = '')
  }


  // const renderTasks = () => {
  //    return props.tsks.map((tsk) => {
  //      return (
  //       <tr>
  //         <td className="collapsing ">
  //             <div className="ui fitted slider checkbox checked">
  //               <input className=" ui right floated" type="checkbox" />{' '}
  //               <label></label>
  //             </div>
  //           </td>
  //           <td style={{ textAlign: 'center' }}>{tsk}</td>
  //           <td style={{ textAlign: 'center' }}>10:00 AM - 10:30 AM</td>
  //           <td style={{ textAlign: 'center' }}>High</td>
  //       </tr>
  //      )
  //    })
  // }

  return (
    <>
    {console.log(props.tsks)}
    <BannerImage />
    <Menu />
    <div className="ui bottom attached segment">
      <table className="ui compact teal celled definition table">
        <thead className="full-width">
          <tr>
            <th></th>
            <th style={{ textAlign: 'center' }}>Task</th>
            <th style={{ textAlign: 'center' }}>Time</th>
            <th style={{ textAlign: 'center' }}>Notes</th>
          </tr>
        </thead>
        <tbody>
          <tr
            style={
              taskColor
                ? { backgroundColor: 'rgba(30, 250, 22, 0.2)' }
                : { backgroundColor: '' }
            }
            onClick={taskComplete}
          >
            <td className="collapsing ">
              <div className="ui fitted slider checkbox checked">
                <input className=" uiright floated" type="checkbox" />{' '}
                <label></label>
              </div>
            </td>
            <td style={{ textAlign: 'center' }}>Graditude</td>
            <td style={{ textAlign: 'center' }}>10:00 AM - 10:30 AM</td>
            <td style={{ textAlign: 'center' }}>High</td>
          </tr>
          <tr
            style={
              taskColor
                ? { backgroundColor: 'rgba(30, 250, 22, 0.2)' }
                : { backgroundColor: '' }
            }
            onClick={taskComplete}
          >
            <td className="collapsing">
              <div className="ui fitted slider checkbox">
                <input type="checkbox" /> <label></label>
              </div>
            </td>
            <td style={{ textAlign: 'center' }}>Shower</td>
            <td style={{ textAlign: 'center' }}>10:30 AM - 10:45 AM</td>
            <td style={{ textAlign: 'center' }}>Low</td>
          </tr>
          <tr
            style={
              taskColor
                ? { backgroundColor: 'rgba(30, 250, 22, 0.2)' }
                : { backgroundColor: '' }
            }
            onClick={taskComplete}
          >
            <td className="collapsing ">
              <div className="ui fitted slider checkbox">
                <input type="checkbox" /> <label></label>
              </div>
            </td>
            <td style={{ textAlign: 'center' }}>Workout</td>
            <td style={{ textAlign: 'center' }}>10:50 AM - 11:45 AM</td>
            <td style={{ textAlign: 'center' }}>Medium</td>
          </tr>
          {/* {renderTasks()} */}
        </tbody>
        <tfoot className="full-width">
          <tr>
            <th></th>
            <th colSpan="4" style={{ textAlign: 'center' }}>
              <AddTask />
              {/* <div className="ui right floated  buttons">
                <button className="ui teal button">Edit Task</button>
                <div className="or"></div>
                <button className="ui red button">Delete Task</button>
              </div> */}
            </th>
          </tr>
        </tfoot>
      </table>
    </div>
    </>
  )
}

const mapStateToProps = (state) => {
  return { tsks: state.tsks }
}

export default connect(mapStateToProps)(Tasks)
